import React from "react";

const EmptyCart = props => {
  return (
    <div className="empty-cart">
      <img
        size = "70%" size ="images/cart_empty.png"
        alt="empty-cart"
      />
      <h2>You cart is empty!</h2>
    </div>
  );
};

export default EmptyCart;
